/**
 * Persona View
 *
 * This is the container that has all actions and components related
 * to de Persona View, were we manage our staff.
 *
 */

 import React from 'react';

 export default function PersonaView() {
   return (
     <div>
           <h1>Vista de persona</h1>
           <h2>
            Aquí estarán los filtros para las personas y se  <br />verán en una linea de tiempo junto a otras acciones.
           </h2>
    </div>

   );
 }
